import React from 'react';
import { StyleSheet, Text, Image, TouchableOpacity, View } from 'react-native';
const OurData = (props) => {
   
    return(
    <View>
        <View style ={styles.container}>
            <Text> </Text>



        </View>
   </View>
    )
}
const styles = StyleSheet.create({
   container:{
    margin:10,
    backgroundColor:'white',
    width:370,
    height:300,
    borderRadius:10,
    shadowColor: "#000",
    shadowOffset: {
        width: 0,
        height: 2,
    },
    shadowOpacity: 0.25,
    shadowRadius: 4.84,

    elevation: 5,
   },

});

export default OurData
